const Checkout = ()=>{

    const [isHidden, setIsHidden] = useState(true);

    function toggleIsHidden() {
      setIsHidden(!isHidden);
    }


    return(
        <div>
        <button onClick={toggleIsHidden}>Toggle</button>
        <div className={isHidden ? 'hidden' : 'visible'}>
          {/* Content goes here */}
        </div>
      </div>
    )
}
export default Checkout
